/* --- Japan Locations Section Styling (Matching Image Layout) --- */

/* General section padding */
.japan-locations-section {
    padding: 60px 0; /* Vertical spacing for the whole section */
}

/* Section title styling */
.sec-title {
    margin-bottom: 40px; /* Space below the main title */
}
.sec-title h2 {
    font-size: 38px;
    font-weight: 700;
    color: #333;
    margin-bottom: 0;
    line-height: 1.2;
}

/* Container for two location items per row on large screens */
.locations-grid {
    /* No custom margins/paddings here, let Bootstrap .row handle it */
}

/* Styling for each individual location block (image + details) */
/* This will control the layout for col-lg-6 or col-md-12 */
.location-item {
    display: flex; /* Makes image and details side-by-side on large screens */
    align-items: flex-start; /* Aligns content to the top */
    background-color: #fff; /* Ensures a clean white background */
    padding-bottom: 30px; /* Vertical space between location items/rows */
}

/* Styling for the image area */
.location-image-area {
    flex-shrink: 0; /* Prevents the image from shrinking */
    width: 200px; /* Fixed width for the image as seen in the example */
    height: 180px; /* Fixed height for consistency */
    margin-right: 30px; /* Horizontal space between image and text details */
    overflow: hidden; /* Ensures image doesn't overflow its fixed dimensions */
}

.location-image-area img {
    width: 100%;
    height: 100%;
    object-fit: cover; /* Covers the area, cropping if needed, maintaining aspect ratio */
    display: block; /* Removes any extra space below the image */
}

/* Styling for the location details (text content) */
.location-details-area {
    flex-grow: 1; /* Allows details to take up the remaining horizontal space */
    padding-top: 5px; /* A slight adjustment to align text vertically with image top */
}

.port-title {
    font-size: 20px;
    font-weight: 600; /* Bolder, but not fully black bold */
    color: #333; /* Dark grey for title */
    margin-bottom: 8px; /* Space below title */
    text-transform: uppercase;
    line-height: 1.3;
}

.port-address {
    font-size: 15px;
    color: #777; /* Lighter grey for address */
    line-height: 1.6;
    margin-bottom: 15px; /* Space below address */
    white-space: normal; /* Allows text to wrap naturally */
}

.contact-info {
    display: flex;
    flex-direction: column; /* Stacks phone and email links vertically */
    gap: 8px; /* Space between phone and email links */
}

.contact-link {
    display: flex;
    align-items: center; /* Aligns icon and text horizontally */
    gap: 8px; /* Space between icon and text */
    color: #3e90e8; /* Blue color for contact text */
    text-decoration: none; /* Removes default underline */
    font-size: 15px;
    transition: none; /* No hover effect on links as per image */
}

.contact-link:hover {
    text-decoration: none; /* Ensure no underline on hover */
    color: #3e90e8; /* Keep color consistent on hover */
}

/* Icon styling (filled, blue) */
.contact-icon {
    width: 20px; /* Size of the icon */
    height: 20px;
    flex-shrink: 0; /* Prevents icon from shrinking */
    fill: #3e90e8; /* Filled icon with blue color */
    stroke: none; /* Ensure no stroke/outline */
}

/* --- Responsive Adjustments --- */

/* For tablets and smaller (Bootstrap's md breakpoint and below) */
@media (max-width: 991px) {
    .sec-title h2 {
        font-size: 32px;
    }
    .location-item {
        flex-direction: column; /* Stack image and details vertically */
        align-items: center; /* Center the stacked items */
        padding-bottom: 25px; /* Adjust vertical spacing */
    }
    .location-image-area {
        width: 100%; /* Image takes full width of its column */
        max-width: 300px; /* Limit image width for aesthetic on tablets if columns are wide */
        height: 200px; /* Adjust image height for tablets */
        margin-right: 0; /* No right margin when stacked */
        margin-bottom: 20px; /* Space below image when stacked */
    }
    .location-details-area {
        width: 100%; /* Details take full width */
        padding-top: 0; /* Remove top padding when stacked */
        text-align: center; /* Center text content when stacked */
    }
    .port-title {
        font-size: 19px;
    }
    .port-address {
        font-size: 14px;
    }
    .contact-info {
        align-items: center; /* Center contact links when details area is centered */
    }
    .contact-link {
        font-size: 14px;
    }
}

/* For mobile phones (Bootstrap's sm breakpoint and below) */
@media (max-width: 767px) {
    .sec-title h2 {
        font-size: 28px;
    }
    .location-item {
        padding-bottom: 20px; /* Further adjust spacing for mobile */
    }
    .location-image-area {
        height: 180px; /* Adjust image height for mobile */
        margin-bottom: 15px;
    }
    .port-title {
        font-size: 18px;
    }
    .port-address {
        font-size: 13px;
    }
    .contact-link {
        font-size: 13px;
    }
    .contact-icon {
        width: 18px;
        height: 18px;
    }
}

