/* Gallery Widget */
.gallery-widget {
    position: relative;
    margin-left: -30px;
    padding-right: 30px;
}

.gallery-widget .outer {
    position: relative;
    margin: 0px -7px;
}

.gallery-widget .outer .image {
    position: relative;
    float: left;
    width: 33.3333%;
    padding: 0px 7px;
    margin-bottom: 15px;
}

.gallery-widget .image img {
    display: block;
    width: 100%;
}

.gallery-widget .image a {
    position: relative;
    display: block;
    border-radius: 10px;
    overflow: hidden;
}

.gallery-widget .image a:before {
    position: absolute;
    left: 0;
    top: 0;
    height: 100%;
    width: 100%;
    background: var(--theme-color2) padding-box content-box;
    opacity: 0.8;
    content: "";
    -webkit-transform: scale(0);
    transform: scale(0);
    border-radius: 10px;
    -webkit-transition: all 300ms ease;
    transition: all 300ms ease;
}

.gallery-widget .image a:hover:before {
    -webkit-transform: scale(1);
    transform: scale(1);
}

.gallery-widget .image a:hover:after {
    -webkit-transform: scale(1);
    transform: scale(1);
}

.gallery-widget .image a:after {
    position: absolute;
    height: 20px;
    width: 20px;
    left: 50%;
    top: 50%;
    margin-left: -10px;
    margin-top: -10px;
    content: "\f0c1";
    text-align: center;
    line-height: 20px;
    font-size: 18px;
    color: #ffffff;
    font-weight: 900;
    font-family: "Font Awesome 5 Free";
    -webkit-transform: scale(0);
    transform: scale(0);
    -webkit-transition: all 300ms ease;
    transition: all 300ms ease;
}

