    position: absolute;
    top: 30px;
    right: 30px;
    font-size: 26px;
    color: var(--theme-color2);
    z-index: 3;
    border-radius: 50%;
    background-color: transparent;
    -webkit-transition: all 500ms ease;
    transition: all 500ms ease;
}

